import React from "react";
import { Main } from "./pages/Main";
import {BrowserRouter as Router, Routes, Route,} from "react-router-dom"
import { useState, useEffect } from 'react';


const App = () => {


	return (
		<Router>
			<Routes>
				<Route path="/Main" element={<Main/>} />
			</Routes>
    	</Router>
	);
};

export default App;
